import AddUsers from './AddUsers';

function App() {
  const dummy_user = [{
    name: "",
    age: ""
  }];

  const [users, updateUsers] = useState(dummy_user);

  const appendNewUser = newUser => {
    updateUsers((currentUsers) => {
      return [newUser, ...currentUsers];
    });
    console.log(users);
  };

  return (
    <div>
      <AddUsers onSubmitAddUser={appendNewUser} />
    </div>
  );
}

export default App;
